import React, {useState} from 'react';
import "../CSS/loginPage.css";
import Logo from "../Assets/Images/Image5.jpg";
import GoogleLoginButton from './googleLoginButton';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleGoogleSuccess = (response) => {
    // Handle the successful Google Sign-In here (e.g., send the token to the server)
    console.log('Google Sign-In successful:', response);
  };

  const handleGoogleFailure = (error) => {
    // Handle the failed Google Sign-In here
    console.error('Google Sign-In failed:', error);
  };

  const handleLogin = (e) => {
    e.preventDefault();
    // Handle the login logic here (e.g., send login credentials to the server)
    console.log('Email:', email);
    console.log('Password:', password);
  };
  return (
    <>
      <div className="login-page">
          <div className="google-signin">
            <GoogleLoginButton
              onSuccess={handleGoogleSuccess}
              onFailure={handleGoogleFailure}
            />
          </div>
          <div className="logo">
            <img src={Logo} alt="Logo" />
          </div>
          <div className="login-container">
            <form className="login-form" onSubmit={handleLogin}>
              <h2>Login</h2>
              <div className="form-group">
                <label>Email</label>
                <input
                  type="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </div>
              <div className="form-group">
                <label>Password</label>
                <input
                  type="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </div>
              <button className = "login-btn" type="submit">Login</button>
            </form>
          </div>
        </div>

    </>

  )
}

export default LoginPage;
